import React from 'react';
import { Todo } from '../Todo/Todo';

export class TodoList extends React.Component {

    constructor(props) {
        super(props);
        
    }

    render() {

        return (
            <div>
                {(this.props.todoList).map((todo, uuidv4, i) => {
                    i+=1;
                    return <Todo todo={todo} idx={i} key={uuidv4} deleteTodo={this.props.deleteTodo} />
                    
                })}
            </div>
        )
    }
 }
